	"las cosas no están muy bien por aquí, mi querida antigua líder Zelida, fue renegada de su cargo.",
    "Hay rumores de que el nuevo líder fue el responsable del polvo mágico",
    "Sería una barbaridad!"
]
,function(){

});

$scope.ACTIONS.MESSAGE.STATIC("Henrietta Lucy",
[
	"Mi colega!, venciste a lito",
    "Que barbaridad!"
]
,function(){

});

$scope.ACTIONS.MESSAGE.STATIC("Logrer",
[
	"La señorita Zelida ha dominado una técnica sorprendente que puede cortar todo a su paso",
	"Ella entrena a todo aquel que la venza en un combate, todos aún lo estamos intentando."
]
,function(){

});

$scope.ACTIONS.MESSAGE.STATIC("Logrer",
[
	"Aprendiste la técnica de destruir!",
	"Eres increible, nadie en este pueblo lo ha conseguido."
]
,function(){

});

var textox = [
"Amor!, has derrotado a Lito, es increible.",
"Sería bueno que vayas a informarle a la profesora Oka, pues les han informado los consejeros que ya es muy tarde :(",
"La magia ha llegado a 5 ciudades más y Oka te dará nuevas misiones, confio en tí"
];
if($scope.ACTIONS.PROGRESS.GETNATURAL('creenlito')){
  textox.push("Otra cosa $amigo, no puedo creer que creas en ese patán de Lito, respeto tus desiciones y creo mucho en ti");
  textox.push("Pero no estoy de acuerdo con eso, Oka y yo lo conocemos desde hace mucho tiempo y sabemos de lo que es capaz, ten cuidado, chao!.");
}
$scope.ACTIONS.MESSAGE.STATIC("Notepa",textox
,function(){

    $scope.ACTIONS.NPC.MOVE("Notepa", 23, 7, function () {
	$scope.ACTIONS.PROGRESS.SET('impresionnotepa'); 
  	$scope.ACTIONS.PLAYER.CLEARASSAULT();    
  });


});
